import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Home from "./pages/home"
import Nav from "./components/Nav";
import "./"

function App() {
  return (
    <Router>
      <div className="app">
        <Nav/>
        <Route path="/" component={Home} />
        {/* <Route exact path="/team" component={Team} /> */}
      </div>
    </Router>
  );
}

export default App;
